import React from "react";
import s from "./Navbar.module.css"
import {NavLink} from "react-router-dom";

const Navbar =()=> {

    return(
        <div className={s.sidebar} >
            <ul>
                {/*NAvLink нужны чтобы страница не перезагружалась при переходе на ссылки*/}
                <li><NavLink className={s.item} href="/profile">Profile</NavLink></li>
                <li><NavLink className={s.item} href="/dialogs">Message</NavLink></li>
                <li><NavLink className={s.item} href="/users">Users</NavLink></li>
                <li><NavLink className={s.item} href="/news">News</NavLink></li>
                <li><NavLink className={s.item} href="/music">Music</NavLink></li>
                <li><NavLink className={s.item} href="/settings">Settings</NavLink></li>
            </ul>
        </div>
    )
}
export default Navbar;
